class MultiseriesChart extends Component {	
	render() {
		const options = {
				animationEnabled: true,	
				title:{
					text: "Ranking Bancario NOV-2020 - OCT-2021 "
				},
				axisY : {
					title: "Ranking de Bancos",
					includeZero: false
				},
				toolTip: {
					shared: true
				},
				data: [this.props.arreglo]/*[{
					type: "line",
					name: "2016",
					showInLegend: true,
					dataPoints: [
						{ y: 155, label: "Jan" },
						{ y: 150, label: "Feb" },
